import React from 'react';
import styled from "styled-components";

const Trade = props => {
  const { trade } = props;


  const CSS = styled.div`
    display: inline;
    .trade-card{
      margin-bottom: 10px;
      display: inline;
      font-size: 12px;
      height: 200px;
      box-shadow: rgba(0, 0, 0, 0.25) 0px 0.0625em 0.0625em, rgba(0, 0, 0, 0.25) 0px 0.125em 0.5em, rgba(255, 255, 255, 0.1) 0px 0px 0px 1px inset;
    }
    .trade-t-sub{
      width: 30%
      display: inline;
      font-size: 400%;
      background:pink;
      display:inline-block;
    }
    .tt{
      display: inline;
    }

  `;
  return (
    <CSS>
      <div className="trade-card">
        <div className="tt">test</div>
        <div> t2</div>
        <div className="trade-t-sub">
          Purchase date:
          {trade.buyDate}
          Purchase price:
          {trade.buyPrice}
          Indicator at Purchase:
          {trade.indicatorAtBuy}
        </div>
        <div className="trade-t-sub">
          Sell date:
          {trade.sellDate}
          Sell price:
          {trade.sellPrice}
          Indicator at Sell:
          {trade.indicatorAtSell}
        </div>
        <div className="trade-card-sub">
          Number of shares:
          {trade.numShares.toFixed(2)}
          Profit Percent:
          ${trade.profitUSD.toFixed(2)}({trade.profitPercent>0?"+":""}{(trade.profitPercent*100).toFixed(2)}%)
          Candle Length:
          {trade.candleLength.toFixed(2)}
        </div>
      </div>

    </CSS>
  )
}

export default Trade;
